import SearchBarPresintation from "./SearchBarPresintation";
import React from "react";
import { useDarkMode } from "../customeMethods/DarkModeContext";

function SearchBarContainer({ handaleSearchVlue }) {
  const { darkMode } = useDarkMode();

  // Return Elements:
  return (
    <SearchBarPresintation
      darkMode={darkMode}
      handaleSearchVlue={handaleSearchVlue}
    />
  );
}

export default SearchBarContainer;
